        super()
        this.state = {}
    }
    render() {
        return (<div>
            <Row>
                <h3>ค้นหาผู้ป่วย:</h3>
                <Input placeholder={"VN"} />
            </Row>

        </div>

        )
    }
}

export default connect()(Person);
